import React from "react";
import Img from "../slike/pattern.png";

const Aboutme = () => {
  const style = {
    backgroundImage: `url(${Img})`,
  };
  return (
    <div
      className="w-screen h-[calc(100%-70px)] absolute top-[70px] bg-red flex justify-center"
      style={style}
    >
      <div className="h-full w-[60%] bg-red flex justify-center">
        <div className="h-full w-[80%] ">
          <h1>Hi, my name is Robert</h1>
          <h1>
            I'm a young self taught front end developer. I haven't been doing
            <br></br>
            this for a long time, I'm still in process of learning.
          </h1>
        </div>
      </div>
    </div>
  );
};

export default Aboutme;
